        right: 0;
}

.find-store .picture {
    position: absolute;
    border-radius: 50%;
    box-shadow: 2px 2px 8px rgba(0, 0, 0, 0.5);
}

.find-store .picture1 {
    top: -60px;
    left: 0;
}

.find-store .picture2 {
    top: 150px;
    left: 250px;
}

.find-store .text-group {
    position: absolute;
        top: 120px;
        left: 550px;
}

.find-store .text-group title {
    margin-bottom: 20px;
}

.find-store .text-group .description {
    margin-bottom: 20px;
}

/* AWRADS */
.awards {
    background-color: #272727;
}

.awards .inner {
    padding: 40px 0;
}

.awards .swiper-container {
    width: 100%;
    height: 40px;
}

.awards .swiper-prev
,   .awards .swiper-next {
    width: 42px;
    height: 42px;
    border: 2px solid #ffffff;
    border-radius: 50%;
    outline: none;
    color: #ffffff;
    opacity: 0.3;
    display: flex;
    justify-content: center;
    align-items: center;
    position: absolute;
        top: 0;
        bottom: 0;
    margin: auto;
}

.awards .swiper-prev {
    left: -100px;
}

.awards .swiper-next {
    right: -100px;
}

.awards .swiper-prev:hover
,   .awards .swiper-next:hover {
    background-color: #ffffff;
    color: #333333;
}




#to-top {
    width: 42px;
    height: 42px;
    background-color: #333333;
    color: #ffffff;
    border: 2px solid #ffffff;
    border-radius: 10px;
    cursor: pointer;
    display: flex;
    justify-content: center;
    align-items: center;
    position: fixed;
        bottom: 30px;
        right: 30px;
    z-index: 9;
}
